tight; // \u56fe\u6807\u6309\u94ae\u53f3\u4fa7\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n$spacing-button_iconOnly_small-paddingTop: $spacing-extra-tight; // \u56fe\u6807\u6309\u94ae\u9876\u90e8\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n$spacing-button_iconOnly_small-paddingBottom: $spacing-extra-tight; // \u56fe\u6807\u6309\u94ae\u5e95\u90e8\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n\n// margin\n$spacing-button_iconOnly_content-marginLeft: $spacing-tight; // \u6309\u94ae\u5de6\u4fa7\u56fe\u6807\u8ddd\u79bb\u6587\u5b57\u95f4\u8ddd\n$spacing-button_iconOnly_content-marginRight: $spacing-tight; // \u6309\u94ae\u53f3\u4fa7\u56fe\u6807\u8ddd\u79bb\u6587\u5b57\u95f4\u8ddd\n\n$font-button-fontWeight: $font-weight-bold; // \u6309\u94ae\u6587\u5b57\u5b57\u91cd\n$height-button_large: $height-control-large; // \u6309\u94ae\u9ad8\u5ea6 - \u5927\u5c3a\u5bf8\n$height-button_small: $height-control-small; // \u6309\u94ae\u9ad8\u5ea6 - \u5c0f\u5c3a\u5bf8\n$height-button_default: $height-control-default; // \u6309\u94ae\u9ad8\u5ea6 - \u9ed8\u8ba4\n\n$width-button-border: $border-thickness; // \u6309\u94ae\u63cf\u8fb9\u5bbd\u5ea6\n$radius-button: var(--semi-border-radius-small); // \u6309\u94ae\u5706\u89d2\u5927\u5c0f\n$radius-button_group: $radius-button; // \u6309\u94ae\u7ec4\u5706\u89d2\u5927\u5c0f\n$width-button-outline: 2px; // \u6309\u94ae\u8f6e\u5ed3\u5bbd\u5ea6\n","@import \"~@semi-bot/semi-theme-universedesign/scss/index.scss\";\n$prefix: 'semi';\n@import './variables.scss';\n@import \"~@semi-bot/semi-theme-universedesign/scss/local.scss\";\n@import './splitButtonGroup.scss';\n\n$module: #{$prefix}-button;\n\n.#{$module} {\n    @include shadow-0;\n    @include font-size-regular;\n    height: $height-button_default;\n    display: inline-flex;\n    align-items: center;\n    justify-content: center;\n    margin: 0;\n    cursor: pointer;\n    user-select: none;\n    border: $width-button-border $color-button_primary-border-default solid;\n    border-radius: $radius-button;\n    padding-left: $spacing-button_default-paddingLeft;\n    padding-right: $spacing-button_default-paddingRight;\n    padding-top: $spacing-button_default-paddingTop;\n    padding-bottom: $spacing-button_default-paddingTop;\n    font-weight: $font-button-fontWeight;\n    outline: none;\n    vertical-align: middle;\n    white-space: nowrap;\n\n    // the specificity of `.#{$module}:focus-visible`  may lower than `reset.css` default `focus-visible` style\n    // so we add a class at the same level\n    &.#{$module}-primary,\n    &.#{$module}-secondary,\n    &.#{$module}-tertiary,\n    &.#{$module}-warning,\n    &.#{$module}-danger {\n        &:focus-visible {\n            outline: $width-button-outline solid $color-button_primary-outline-focus;\n        }\n    }\n\n    &-danger {\n        background-color: $color-button_danger-bg-default;\n        color: $color-button_danger-text-default;\n        &:hover {\n            background-color: $color-button_danger-bg-hover;\n        }\n        &:active {\n            background-color: $color-button_danger-bg-active;\n        }\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_danger_borderless-text-default;\n        }\n        &:not(.#{$module}-borderless):not(.#{$module}-light):focus-visible {\n            outline: $width-button-outline solid $color-button_danger-outline-focus;\n        }\n    }\n    &-warning {\n        background-color: $color-button_warning-bg-default;\n        color: $color-button_warning-text-default;\n        &:hover {\n            background-color: $color-button_warning-bg-hover;\n        }\n        &:active {\n            background-color: $color-button_warning-bg-active;\n        }\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_warning_borderless-text-default;\n        }\n        &:not(.#{$module}-borderless):not(.#{$module}-light):focus-visible {\n            outline: $width-button-outline solid $color-button_warning-outline-focus;\n        }\n    }\n    &-tertiary {\n        background-color: $color-button_tertiary-bg-default;\n        color: $color-button_tertiary-text-default;\n        &:hover {\n            background-color: $color-button_tertiary-bg-hover;\n        }\n        &:active {\n            background-color: $color-button_tertiary-bg-active;\n        }\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_tertiary_solid-text-default;\n        }\n    }\n    &-primary {\n        background-color: $color-button_primary-bg-default;\n        color: $color-button_primary-text-default;\n        &:not(.#{$module}-borderless):not(.#{$module}-light):hover {\n            background-color: $color-button_primary-bg-hover;\n        }\n        &:not(.#{$module}-borderless):not(.#{$module}-light):active {\n            background-color: $color-button_primary-bg-active;\n        }\n\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_primary_borderless-text-default;\n        }\n    }\n    &-secondary {\n        background-color: $color-button_secondary-bg-default;\n        outline-color: $color-button_secondary-border-default;\n        color: $color-button_secondary-text-default;\n        &:hover {\n            background-color: $color-button_secondary-bg-hover;\n        }\n        &:active {\n            background-color: $color-button_secondary-bg-active;\n        }\n\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_secondary_borderless-text-default;\n        }\n    }\n    &-disabled {\n        color: $color-button_disabled_solid-text-default;\n        background-color: $color-button_disabled-bg-default;\n        &:not(.#{$module}-borderless):not(.#{$module}-light):hover {\n            color: $color-button_disabled-text-hover;\n            background-color: $color-button_disabled-bg-hover;\n        }\n        cursor: not-allowed;\n\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_disabled-text-default;\n        }\n    }\n    &-borderless {\n        background-color: transparent;\n        border: $width-button_borderless-border $color-button_borderless-border-default solid;\n        &:not(.#{$module}-disabled):hover {\n            background-color: $color-button_borderless-bg-hover;\n            border: $width-button_borderless-border $color-button_borderless-border-hover solid;\n        }\n        &:not(.#{$module}-disabled):active {\n            background-color: $color-button_borderless-bg-active;\n            border: $width-button_borderless-border $color-button_borderless-border-active solid;\n        }\n    }\n\n    &-light {\n        background-color: $color-button_light-bg-default;\n        border: $width-button_light-border $color-button_light-border-default solid;\n        &:not(.#{$module}-disabled):hover {\n            background-color: $color-button_light-bg-hover;\n            border: $width-button_light-border $color-button_light-border-hover solid;\n        }\n        &:not(.#{$module}-disabled):active {\n            background-color: $color-button_light-bg-active;\n            border: $width-button_light-border $color-button_light-border-active solid;\n        }\n    }\n    &-size-small {\n        height: $height-button_small;\n        padding-top: $spacing-button_small-paddingTop;\n        padding-bottom: $spacing-button_small-paddingBottom;\n        padding-left: $spacing-button_small-paddingLeft;\n        padding-right: $spacing-button_small-paddingRight;\n    }\n    &-size-large {\n        height: $height-button_large;\n        padding-top: $spacing-button_large-paddingTop;\n        padding-bottom: $spacing-button_large-paddingBottom;\n        padding-left: $spacing-button_large-paddingLeft;\n        padding-right: $spacing-button_large-paddingRight;\n    }\n    &-block {\n        width: 100%;\n    }\n\n    &-group {\n        & > .#{$module} {\n            margin: 0;\n            padding-left: 0;\n            padding-right: 0;\n            border-radius: 0;\n\n            .#{$module}-content {\n                padding-left: $spacing-button_default-paddingLeft;\n                padding-right: $spacing-button_default-paddingRight;\n            }\n\n            &-size-large {\n                .#{$module}-content {\n                    padding-left: $spacing-button_large-paddingLeft;\n                    padding-right: $spacing-button_large-paddingRight;\n                }\n            }\n\n            &-size-small {\n                .#{$module}-content {\n                    padding-left: $spacing-button_small-paddingLeft;\n                    padding-right: $spacing-button_small-paddingRight;\n                }\n            }\n\n            &.#{$module}-with-icon-only {\n                padding-left: 0;\n                padding-right: 0;\n\n                .#{$module}-content {\n                    padding-left: $spacing-button_iconOnly_default-paddingLeft;\n                    padding-right: $spacing-button_iconOnly_default-paddingRight;\n                }\n\n                &.#{$module}-size {\n                    &-small {\n                        .#{$module}-content {\n                            padding-left: $spacing-button_iconOnly_small-paddingLeft;\n                            padding-right: $spacing-button_iconOnly_small-paddingRight;\n                        }\n                    }\n\n                    &-large {\n                        .#{$module}-content {\n                            padding-left: $spacing-button_iconOnly_large-paddingLeft;\n                            padding-right: $spacing-button_iconOnly_large-paddingRight;\n                        }\n                    }\n                }\n            }\n\n            &:first-child {\n                border-top-left-radius: $radius-button_group;\n                border-bottom-left-radius: $radius-button_group;\n            }\n            &:not(:last-child) {\n                .#{$prefix}-button-content {\n                    border-right: $width-button_group-border $color-button_group-border-default solid;\n                }\n            }\n            &:last-child {\n                border-top-right-radius: $radius-button_group;\n                border-bottom-right-radius: $radius-button_group;\n            }\n        }\n    }\n}\n\n@import './rtl.scss';\n","@mixin shadow-0 {\n      box-shadow: none;\n};\n@mixin shadow-1 {\n      box-shadow: none;\n};\n@mixin shadow-2 {\n      box-shadow: 0px 2px 4px rgba(0,0,0,0.14),0px 0px 1px rgba(0,0,0,0.16);\n};\n@mixin shadow-knob {\n      box-shadow: 0 4px 6px rgba(0,0,0,0.1),0 0 1px rgba(0,0,0,0.3);\n};\n@mixin shadow-elevated {\n      box-shadow: 0px 0px 1px rgba(0,0,0,0.3),0px 4px 14px rgba(0,0,0,0.1);\n};\n\n@mixin box-sizing() {\n    box-sizing: border-box;\n}\n\n@mixin all-center {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n}\n\n@mixin ver-center {\n    display: flex;\n    align-items: center;\n}\n\n@mixin hor-center {\n    display: flex;\n    justify-content: center;\n}\n\n@mixin text-overflow-hidden {\n    overflow: hidden;\n    text-overflow: ellipsis;\n    white-space: nowrap;\n}\n\n@mixin no-scrollbar {\n    &::-webkit-scrollbar {\n        // width: 8px;\n        display: none;\n    }\n    &::-webkit-scrollbar-thumb {\n        background-color: transparent;\n        // background-color: $grey-2;\n    }\n    &::-webkit-scrollbar-track {\n        opacity: 0;\n        background-color: rgba(0, 0, 0, 0.05);\n        background-color: transparent;\n        // background-color: $grey-0;\n    }\n    &:hover {\n        &::-webkit-scrollbar {\n            display: block;\n            width: 8px;\n            // width: 12px;\n        }\n        &::-webkit-scrollbar-thumb {\n            border-radius: 10px;\n            background-color: var(--semi-gray-3);\n        }\n        &::-webkit-scrollbar-track {\n            // background-color: rgba(0, 0, 0, 0.05);\n        }\n    }\n}","@mixin font-size-header-1 {\nfont-size: 30px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 38px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-header-2 {\nfont-size: 24px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 32px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-header-3 {\nfont-size: 20px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 28px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-header-4 {\nfont-size: 18px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 26px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-header-5 {\nfont-size: 16px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 24px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-header-6 {\nfont-size: 16px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 24px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-small {\nfont-size: 12px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 16px;\nletter-spacing: 0px;\n\n\n}\n@mixin font-size-regular {\nfont-size: 14px;\nfont-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif;\nline-height: 20px;\nletter-spacing: 0px;\n\n\n}\n","\n$prefix: 'semi';\n\n/* sizing */\n$height-control-small: 24px; // \u8868\u5355\u9879\u9ad8\u5ea6 - \u5c0f\u5c3a\u5bf8\n$height-control-default: 32px; // \u8868\u5355\u9879\u9ad8\u5ea6 - \u9ed8\u8ba4\u5c3a\u5bf8\n$height-control-large: 40px; // \u8868\u5355\u9879\u9ad8\u5ea6 - \u5927\u5c3a\u5bf8\n$border-thickness: 0; // \u63cf\u8fb9\u5bbd\u5ea6 - \u96f6\n$border-thickness-control: 1px; // \u63cf\u8fb9\u5bbd\u5ea6 - \u9ed8\u8ba4\u72b6\u6001\uff08checkbox \u7b49\uff09\n$border-thickness-control-focus: 1px; // \u63cf\u8fb9\u5bbd\u5ea6 - focus \u72b6\u6001\uff08checkbox \u7b49\uff09\n\n$width-icon-extra-small: 8px; // \u56fe\u6807\u5c3a\u5bf8 - \u8d85\u5c0f\n$width-icon-small: 12px; // \u56fe\u6807\u5c3a\u5bf8 - \u5c0f\n$width-icon-medium: 16px; // \u56fe\u6807\u5c3a\u5bf8 - \u4e2d\n$width-icon-large: 20px; // \u56fe\u6807\u5c3a\u5bf8 - \u5927\n$width-icon-extra-large: 24px; // \u56fe\u6807\u5c3a\u5bf8 - \u8d85\u5927\n\n/* spacing */\n$spacing-none: 0; // \u95f4\u8ddd - \u96f6\n$spacing-super-tight: 2px; // \u95f4\u8ddd - \u6781\u7d27\u51d1\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-extra-tight: 4px; // \u95f4\u8ddd - \u8d85\u7d27\u51d1\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-tight: 8px; // \u95f4\u8ddd - \u7d27\u51d1\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-base-tight: 12px; // \u95f4\u8ddd - \u9ed8\u8ba4\uff08\u504f\u7d27\u51d1\uff09\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-base: 16px; // \u95f4\u8ddd - \u9ed8\u8ba4\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-base-loose: 20px; // \u95f4\u8ddd - \u9ed8\u8ba4\uff08\u504f\u5bbd\u677e\uff09\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-loose: 24px; // \u95f4\u8ddd - \u5bbd\u677e\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-extra-loose: 32px; // \u95f4\u8ddd - \u8d85\u5bbd\u677e\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n$spacing-super-loose: 40px; // \u95f4\u8ddd - \u6781\u5bbd\u677e\u5c3a\u5bf8\u5185/\u5916\u8fb9\u8ddd\n\n// z-index\n$z-portal: 1; // \u62bd\u8c61\u63d2\u69fd\uff0c\u9002\u7528\u4e8e\u672a\u7ecf\u7279\u6b8a\u5b9a\u5236\u7684\u6240\u6709\u7ec4\u4ef6\n$z-affix: 10; // \u56fa\u5b9a\u4f4d\u7f6e\u7684\u9875\u9762\u5143\u7d20 z-index\n$z-backtop: 10; // \u8fd4\u56de\u9876\u90e8 z-index\n$z-badge: 10; // badge z-index\n$z-modal: 1000; // modal z-index\n$z-modal-mask: 1000; // modal \u906e\u7f69 z-index\n\n$z-toast: 1010; // toast \u7ec4\u4ef6 z-index\n$z-notification: 1010; // notification \u7ec4\u4ef6 z-index\n$z-popover: 1030; // popover \u7ec4\u4ef6 z-index\n$z-dropdown: 1050; // dropdown \u7ec4\u4ef6 z-index\n$z-tooltip: 1060; // tooltip \u7ec4\u4ef6 z-index\n// $z-avatar-default: 100;\n\n// font\n\n\n$font-family-regular: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Helvetica Neue', Helvetica, Arial, sans-serif; // semi \u9884\u7f6e\u5b57\u4f53\u56de\u9000\n$font-size-small: 12px; // \u5c0f\u6587\u672c\u5b57\u53f7\n$font-size-regular:  14px; // \u5e38\u89c4\u6587\u672c\u5b57\u53f7\n\n$font-size-header-6:  16px; // \u516d\u7ea7\u6807\u9898\u5b57\u53f7\n$font-size-header-5: 16px; // \u4e94\u7ea7\u6807\u9898\u5b57\u53f7\n$font-size-header-4: 18px; // \u56db\u7ea7\u6807\u9898\u5b57\u53f7\n$font-size-header-3: 20px; // \u4e09\u7ea7\u6807\u9898\u5b57\u53f7\n$font-size-header-2: 24px; // \u4e8c\u7ea7\u6807\u9898\u5b57\u53f7\n$font-size-header-1: 30px; // \u4e00\u7ea7\u6807\u9898\u5b57\u53f7\n\n$font-weight-light: 200; // \u5b57\u91cd - \u8f7b\n$font-weight-regular: 400; // \u5b57\u91cd - \u5e38\u89c4\n$font-weight-bold: 600; // \u5b57\u91cd - \u52a0\u7c97\n\n\n","$module: #{$prefix}-button;\n\n.#{$prefix}-rtl,\n.#{$prefix}-portal-rtl {\n    .#{$module} {\n        direction: rtl;\n\n        padding-left: $spacing-button_default-paddingRight;\n        padding-right: $spacing-button_default-paddingLeft;\n\n        &-size-small {\n            padding-l